//  <ul>
//  {listings.map((data, key) => {
//    return (<li key={key}><HomeListingCard data={data} /></li>)
//  })}
//</ul>
  return (
      <HomeStyles>

        <Helmet>
          <title>Pubweb Code Challenge</title>
          <meta name="description" content="Pubweb Code Challenge" />
        </Helmet>


        <ul>
          {listings.map((data, key) => {
            return (
              <li key={key}>
                <HomeListingCard 
                  key={key}
                  imageURL={data.imageURL}
                  startingPrice={data.startingPrice}
                  beds={data.beds}
                  baths={data.baths}
                  
                />
              </li>
            )
          })}
        </ul>

      </HomeStyles>
  )
};

export default Home;
